import styled from 'styled-components';

const Container = styled.div`
    width: 400px;
    margin: 0 auto;
    text-align: center;
`;

const Table = styled.div`
    display: grid;
    width: 300px;
    margin: 20px;
`;

export function Score ({
    firstName,
    score: {math, english, history} }) {
    return (
        <div>
            <h2>{firstName}'s Scores</h2>
            <Table>
                <tbody>
                    <tr>
                        <th>Subject</th>
                        <th>Score</th>
                    </tr>
                    <tr>
                        <h3>"Math"</h3>
                        <p>tt{math}</p>
                        <h3>"English"</h3>
                        <p>{english}</p>
                        <h3>"History"</h3>
                        <p>{history}</p>
                    </tr>
                </tbody>
            </Table>
        </div>
    );
};
